import styled from "styled-components";
import NavigationItem from "./NavigationItem";

function Navigation(){
    return <Block>

        <NavigationItem/>
        <NavigationItem/>
        <NavigationItem/>

    </Block>
}

const Block = styled.div`
    position: absolute;
    width: 100%;
    bottom: 0;
    left: 0;
    display: flex;
    height: 40px;

`

export default Navigation;
